import { Grid, TextField, Button } from "@material-ui/core";
import { Container, Typography, Paper } from "@material-ui/core";

const Bookingform = () => {
  function submitting() {
    const getVehiclenumber = (e) => {
      console.log(e.target.value);
    };

    const bookedSlot = (e) => {
      console.log(e.target.value);
    };

    const EntryTime = (e) => {
      console.log(e.target.value);
    };
    const ExittTme = (e) => {
      console.log(e.target.value);
    };
  }

  return (
    <Container style={{ padding: 16, margin: "auto", maxWidth: 800 }}>
      <Typography
        variant="h4"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Parking Lot Management System !
      </Typography>
      <Grid>
        <Paper style={{ padding: 16 }}>
          <Grid container justify="flex-start" alignItems="center" spacing={2}>
            <Grid item xs={12}>
              <TextField
                label="Vehicle Number"
                color="secondary"
                variant="outlined"
                type="Text"
                fullWidth
                onChange={getVehiclenumber}
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                label="Entry Time"
                color="secondary"
                variant="outlined"
                fullWidth
                type="time"
                defaultValue="00:00:00"
                onChange={EntryTime}
              />
            </Grid>

            <Grid item xs={12} mt={4}>
              <TextField
                label="Exit Time"
                color="secondary"
                variant="outlined"
                fullWidth
                type="time"
                defaultValue="00:00:00"
                onChange={ExittTme}
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                label="NumberOfSlot"
                color="secondary"
                variant="outlined"
                type="Text"
                fullWidth
                onChange={bookedSlot}
              />
            </Grid>

            <Grid
              container
              justify="space-evenly"
              alignItems="center"
              style={{ padding: 16 }}
            >
              <Button
                variant="contained"
                color="primary"
                type="submit"
                onClick={submitting()}
              >
                Submit
              </Button>
              <Button variant="contained" color="secondary" type="button">
                Reset
              </Button>
            </Grid>
          </Grid>
        </Paper>
      </Grid>
    </Container>
  );
};

export default Bookingform;
